import React, { Component } from 'react';

class Feed extends Component {

  componentDidMount() {
    const { token } = this.props;  

    fetch(`https://api.instagram.com/v1/media/search?lng=2&lat=5&access_token=${token}`)
      .then(res => res.json())
      .then(res => console.log(res));
  }

  render() {
    return (
      <div>

      </div>
    );
  }
}

export default Feed;
